import React from 'react';

interface ToolbarProps {
  onExport?: () => void;
  onImport?: () => void;
}

const Toolbar: React.FC<ToolbarProps> = ({ onExport, onImport }) => {
  return (
    <div className="toolbar" style={{
      display: 'flex',
      justifyContent: 'space-between',
      padding: '12px 20px',
      background: 'linear-gradient(90deg, #0f0f15 0%, #151520 100%)',
      borderBottom: '1px solid rgba(255, 255, 255, 0.1)',
      boxShadow: '0 2px 10px rgba(0,0,0,0.2)'
    }}>
      <div style={{ display: 'flex', alignItems: 'center', gap: '15px' }}>
        <h2 style={{ 
          margin: 0, 
          fontSize: '22px', 
          color: '#fff',
          fontWeight: 700,
          letterSpacing: '0.5px',
          background: 'linear-gradient(to right, #36d1dc, #5b86e5)',
          WebkitBackgroundClip: 'text',
          WebkitTextFillColor: 'transparent'
        }}>Autai</h2>
        <div style={{
          display: 'flex',
          flexDirection: 'column',
          color: '#8a9db8',
          fontSize: '12px',
          borderLeft: '1px solid rgba(255, 255, 255, 0.2)',
          paddingLeft: '15px',
          lineHeight: '1.4'
        }}>
          <span>By Fadhil</span>
          <span style={{ fontStyle: 'italic' }}>-Feaven Technologies-</span>
        </div>
      </div>

      <div style={{ display: 'flex', gap: '12px' }}>
        {/* Import button */}
        <button 
          onClick={onImport}
          style={{
            background: 'linear-gradient(135deg, #11998e 0%, #38ef7d 100%)',
            color: 'white',
            border: 'none',
            padding: '8px 16px',
            borderRadius: '8px',
            cursor: 'pointer',
            display: 'flex',
            alignItems: 'center',
            gap: '8px',
            fontWeight: '600',
            boxShadow: '0 2px 10px rgba(17, 153, 142, 0.3)',
            transition: 'all 0.3s ease'
          }}
          onMouseOver={(e) => {
            e.currentTarget.style.transform = 'translateY(-2px)';
            e.currentTarget.style.boxShadow = '0 4px 15px rgba(17, 153, 142, 0.4)';
          }}
          onMouseOut={(e) => {
            e.currentTarget.style.transform = 'translateY(0)';
            e.currentTarget.style.boxShadow = '0 2px 10px rgba(17, 153, 142, 0.3)';
          }}
        >
          <span>Import Model</span>
        </button>

        {/* Export button */}
        <button 
          onClick={onExport}
          style={{
            background: 'linear-gradient(135deg, #4776E6 0%, #8E54E9 100%)',
            color: 'white',
            border: 'none',
            padding: '8px 16px',
            borderRadius: '8px',
            cursor: 'pointer',
            display: 'flex',
            alignItems: 'center',
            gap: '8px',
            fontWeight: '600',
            boxShadow: '0 2px 10px rgba(71, 118, 230, 0.3)',
            transition: 'all 0.3s ease'
          }}
          onMouseOver={(e) => {
            e.currentTarget.style.transform = 'translateY(-2px)';
            e.currentTarget.style.boxShadow = '0 4px 15px rgba(71, 118, 230, 0.4)';
          }}
          onMouseOut={(e) => {
            e.currentTarget.style.transform = 'translateY(0)';
            e.currentTarget.style.boxShadow = '0 2px 10px rgba(71, 118, 230, 0.3)';
          }}
        >
          <span>Export Model</span>
        </button>
      </div>
    </div>
  );
};

export default Toolbar;
